food justice isnâ€™t just about cleaner watersheds, eradicating factory farming or more $$ in the pockets of the real stewards of the land; small organic and permaculture minded farmers and ranchers.  itâ€™s about  gender equality too, in all realms of this movement.  shout out to  for publishing this story.  over the years, i have asked most of the women who have worked in various food service depaments at the co-op if they have experienced sexual harassment or discrimination in the greater reno food industry.  not to my surprise, all of the responses sounded a lot like corbina griecoâ€™s when she was interviewed for the edible sf featured aicle, â€œlike most young women in kitchens i endured by playing along and/or keeping my mouth shut.â€ does that sound familiar?  in order for women to thrive in this male dominated industry we must pretend like things donâ€™t happen. 
things are changing, slowly but surely.  take for instance the james beard restaurant awards... everyone knows that they are a big deal for restaurants across the country, and this year the judges were asked to think a little broader than they have in the past. the judges were asked to,Â â€œwhen considering the candidacy of a person or restaurant, bear in mind that award winners are held up as role models. if you have concerns about a chef, restaurateur or beverage professional, or about the culture around a restaurant or restaurant group, leave the person or business out of your nominations.â€ this as more and more awareness is being drawn to sexual harassment in the restaurant industry. and the result? 40% of nominees were female, up 13% from the year before, where only a quaer of nominations went to female chefs and restauranteurs.  
if the fundamentals of food systems are going to change then aicles like this need to be written, along with one from the james beard foundationâ€™s webpage: â€œwe need to suppo women in the restaurant industryâ€ - check it out ğŸ¥° (link in bio)

